COMMENT ON TABLE public.users IS 'Dashboard users - may or may not be community members';


--
-- Name: v_member_profiles; Type: VIEW; Schema: public; Owner: community_user
--

CREATE VIEW public.v_member_profiles AS
 SELECT cm.id AS membership_id,
    cm.community_id,
    cm.member_id,
    cm.member_type,
    cm.role,
    cm.is_active AS membership_active,
    m.name,
    m.phone,
    m.email,
    m.is_active AS member_active,
        CASE
            WHEN ((cm.member_type)::text = 'alumni'::text) THEN jsonb_build_object('college', ap.college, 'graduation_year', ap.graduation_year, 'degree', ap.degree, 'department', ap.department, 'current_organization', ap.current_organization, 'designation', ap.designation, 'city', ap.city, 'skills', ap.skills, 'domains', ap.domains)
            WHEN ((cm.member_type)::text = 'entrepreneur'::text) THEN jsonb_build_object('company', ep.company, 'industry', ep.industry, 'company_stage', ep.company_stage, 'services_offered', ep.services_offered, 'expertise', ep.expertise, 'city', ep.city)
            WHEN ((cm.member_type)::text = 'resident'::text) THEN jsonb_build_object('apartment_number', rp.apartment_number, 'building', rp.building, 'profession', rp.profession, 'skills', rp.skills, 'can_help_with', rp.can_help_with)
            ELSE NULL::jsonb
        END AS profile_data,
    cm.joined_at,
    cm.updated_at
   FROM ((((public.community_memberships cm
     JOIN public.members m ON ((cm.member_id = m.id)))
     LEFT JOIN public.alumni_profiles ap ON (((cm.id = ap.membership_id) AND ((cm.member_type)::text = 'alumni'::text))))
     LEFT JOIN public.entrepreneur_profiles ep ON (((cm.id = ep.membership_id) AND ((cm.member_type)::text = 'entrepreneur'::text))))
     LEFT JOIN public.resident_profiles rp ON (((cm.id = rp.membership_id) AND ((cm.member_type)::text = 'resident'::text))));


ALTER VIEW public.v_member_profiles OWNER TO community_user;

--
-- Name: VIEW v_member_profiles; Type: COMMENT; Schema: public; Owner: community_user
--

COMMENT ON VIEW public.v_member_profiles IS 'Complete member profile with type-specific data aggregated';


